B.Mj=new A.bP("30","Atlas Copco GA160 Electric Air Compressor (1000v)","Atlas Copco GA160 air compressors provide high-quality compressed air in the harshest environmental conditions. Incorporating the patented Atlas Copco\u2019s oil-injected screw element, they provide a long and trouble-free life at the lowest possible operating cost. ","assets/images/cc-atlas-copco-ga160-electric-air-compressor-1000v.jpg","AIR COMPRESSOR","Atlas-Copco-GA160-Electric-Air-Compressor.pdf","Atlas Copco GA160 air compressors provide high-quality compressed air in the harshest environmental conditions.\n\nIncorporating the patented Atlas Copco\u2019s oil-injected screw element, they provide a long and trouble-free life at the lowest possible operating cost.\n\nAt their heart are state-of-the-art compression elements based on innovative asymmetric rotor profiles and powered by a high-efficiency electric motor.\n\nCombined with a built-to-last drive system and heavy-duty inlet air filters, this results in maximum reliability to operate in the toughest conditions and at ambient temperatures up to 55\xb0C/131\xb0F.\n\nThe innovative design of the GA screw compressors reduces your energy bill and overall compressor lifecycle costs.\n\nGA oil-injected compressors are pre-assembled packages: installation is fault-free, commissioning time is low and no external instrumentation air is required.","High efficiency\n\nAir treatment integration\n\nEasy installation\n\nHighest reliability\n\nIntegrated air system\n\nReduced energy costs","")
