B.Mm=new A.bP("7",'Dehumidification Module; Desiccant, 1-Phase, 29.75"W x 15.25"D x 22"H, 120 VAC',"Extends shelf life of pharmaceuticals, semiconductor components, and other sensitive materials.",u.e,"CLEANROOM HVAC","",'Dimensions: 29.75" W x 15.25" D x 22" H (756 mm x 387 mm x 559 mm)\n\nPower: 120 VAC/60 Hz Power Consumption: 1,400 Watts Full Load Amps: 12\n\nMaterials: Corrosion-proof 16 guage steel and steel bed drive components\n\nDesiccant material is 2-5 mm spherical silica gel\n\nProcess Air Flow: 50 CFM ( 84.95 m^3/h)\n\nReactivation Air Flow: 15 CFM ( 25.49 m^3/h)\n\nReactivation Heat: 3,240 BTUH\n\nExtends shelf life of pharmaceuticals, semiconductor components, food products, and other sensitive materials\n\nProvides the humidity stability required by FDA and other regulating agencies\n\nHorizontal-bed design provides the lowest dry air temperature and most desiccant/CFM of Air in the industry',"\u2022 Type: Dehumidification Module\n\n\u2022 Process Air Flow: 50 CFM\n\n\u2022 Unit of Measure: EA\n\n\u2022 Electrical Specifications: 120 V, 1 Ph, 60 Hz\n\n\u2022 Weight, Product: 85 Lbs\n\n\u2022 Weight, Shipping: 100 lb\n\n\u2022 Package Type: Crate","")
B.Mn=new A.bP("2","Parker Transair Wireless Technology Powered By Scout\u2122","Transair wireless technology powered by SCOUT\u2122 technology helps you keep your system healthy and operating efficiently.","assets/images/cc-parker-transair-wireless-technology-powered-by-scout.png","ACCESSORIES","","TransAir Wireless Technology Compressed Air System Condition Monitoring \u2013 Engineering your success.\n\nHaving accurate, timely readings on the performance of your compressed air piping system can mean the difference between identifying a problem before it occurs, or incurring added costs for equipment repairs\u2026not to mention lost revenue.\n\nSCOUT consists of a wide range of sensors that provide consistent and accurate readings for pressure, temperature, humidity, power, and flow. The system collects data so you can take the necessary steps to optimize your compressed air equipment and your system\u2019s performance. The easy-to-use web-based interface also alerts the user to unexpected conditions that may damage components and equipment over time.\n\nSCOUT Technology puts vital information and analytics in the palm of your hand to ensure your compressed air system is running at optimum levels. Let SCOUT Technology MONITOR your Transair wireless technology compressed air piping system, ALERT you to system changes, and provide DATA that helps reduce downtime and increase productivity.","","")
